import React, {Component} from 'react';
import Slider from 'react-slick';

export default class SimpleSlider extends Component {
  render() {
    const settings = {
      dots: true,
      infinite: true,
      speed: 500,
      slidesToShow: 1,
      slidesToScroll: 1
    };
    return (
      <Slider {...settings}>
        <div>
          <img src="/images/food.png"/>
        </div>
        <div>
          <img src="https://i1.wp.com/theverybesttop10.com/wp-content/uploads/2015/05/Top-10-Crazy-and-Unusual-Square-Foods-10-510x498.jpg?resize=600%2C586"/>
        </div>
        <div>
          <img src="/images/food.png"/>
        </div>
        <div>
          <img src="/images/food.png"/>
        </div>
        <div>
          <img src="/images/food.png"/>
        </div>
      </Slider>
    );
  }
}
